import React from 'react'
import '../room_card.css';
function RoomTimer(props) {
    const isEmergency = props.timeLeft < 6;
    const classNameObj = {
        true: "roomTimer__ roomTimer__secondary",
        false: "roomTimer__ roomTimer__danger"
    }
    return (
        <div className={classNameObj[isEmergency]}>
            <span className ="timer-text">15 min left</span>
        </div>
    )
}

export default RoomTimer
